interface TicTacToeInterface {
    TicTacToe: TypeTicTacToe[]
}


export type TypeTicTacToe = {
    id: number,
    cross: boolean,
    circle: boolean,
}





enum TicTacToeActionsTypes {
    REMOVE_CROSS = "REMOVE_CROSS"
}

interface RemoveCross {
    type: TicTacToeActionsTypes.REMOVE_CROSS,
    payload: TypeTicTacToe,
}

type TicTacToeActions = RemoveCross


const defaultState: TicTacToeInterface = {
    TicTacToe: [
        {id: 1, cross: true, circle: true},
        {id: 2, cross: false, circle: false},
        {id: 3, cross: false, circle: false},
        {id: 4, cross: false, circle: false},
        {id: 5, cross: false, circle: false},
        {id: 6, cross: false, circle: false},
        {id: 7, cross: false, circle: false},
        {id: 8, cross: false, circle: false},
        {id: 9, cross: false, circle: false},
    ]
}


export const Reducer = (state = defaultState, action: TicTacToeActions): TicTacToeInterface => {
    switch(action.type) {
        case TicTacToeActionsTypes.REMOVE_CROSS:
            return{...state}
        default:
            return{ ...state}
    }
}
